import React , {useEffect, useState} from "react";
import {  Link , useHistory , useParams } from "react-router-dom";


function Mainpage(){
    
    const history=useHistory();
    const { id }=useParams();


    return(



        <>
        <div>
        <Link to={"/front/"+id}>
        <button  id="BUT">Register</button>
        </Link>
        </div>
        </>
    )

}
export default Mainpage();
